import axios from 'axios';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import Grid from '@material-ui/core/Grid';
import Config from '../Config';

const styles = theme => ({
  jumbotron:{
    padding: '1rem 2rem',
    bottomMargin:'2rem',     
},
    center : {
        margin: 'auto',      
        minWidth: 1100,
        padding: 10,
        // border: '2px solid green'
      },
    card: {
        minWidth: 1100
    },           

      searchbar:{
        width: 1100
      },


});



class Try extends React.Component {
  state ={
    topicTagCountsInSubsectors: this.props.topic,
    }

    componentDidMount(){
        this.setState({
            topicTagCountsInSubsectors: this.props.topic
    });}

    componentWillReceiveProps(nextProps){
        this.setState({
            topicTagCountsInSubsectors : nextProps.topic
    });
      }

      render(){  
        const {classes} = this.props;
        //const{topicTagCountsInSubsectors} = this.state;
        console.log(this.state.topicTagCountsInSubsectors)
    return (
            <div>
            <div className={classes.jumbotron}>
            <Grid container justify = "center">
                <Card className={classes.card}>
                    <CardContent >
                    <Typography gutterBottom variant="h6" component="h5">
                            General
                        </Typography>


                    </CardContent>
                    <Divider variant="middle"/>
                    <CardContent >
                    <Typography component="div" className={classes.contentHolder}>
              <Grid container spacing={24} direction="column" wrap="nowrap" 
                    justify="flex-start" className={classes.mainContainer}> 
                {/* Subsections for each replicate */}
                <Grid item>
                <img src={(this.state.topicTagCountsInSubsectors.topicID)}/>
                </Grid>   
              </Grid>
            </Typography>

                    </CardContent>

                </Card>
            </Grid>
                <br/> 
                {/* Sample Explore Table */}

            </div>
            </div>

    );
}}

Try.propTypes = {
    classes: PropTypes.object.isRequired,
  };

  export default withStyles(styles)(Try);
